import React from 'react';
import logo from './logo.svg';
import './App.css';
import Login from './screens/Login.js'
import Signup from './screens/Signup'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Route path='/login'>
          <Login />
        </Route>
        <Route path='/signup'>
          <Signup />
        </Route>
      </Router>
    </div>
  );
}

export default App;
